import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '../materialUiComps/Typography';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  img: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <React.Fragment>
       <Typography variant="h3" marked="center" align="center" component="h2">
          Our Partnerships
      </Typography>
      <Grid container>
        <Grid item sm>
          <img src="https://images.unsplash.com/photo-1524368535928-5b5e00ddc76b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1500&q=80"
           width="200"
          ></img>
          <br></br>
          <Paper CenteredGrid> Left panel</Paper>
        </Grid>
        <Grid item sm>
          <Paper>Middle Panel</Paper>
        </Grid>
        <Grid item sm>
          <Paper>Right Panel</Paper>
        </Grid>
      </Grid>
    </React.Fragment>
  );
}

